SubhanAlloh! Juda ham chiroyli suzlar lekin ammo biroq bunaqa xadis yoq. Bu domal juda kup joyda yoq hadislarni yoki yoq gaplarni gapiryaptilar. Men xozir shu xadisni qidirdim lekin bu aqa xadis kelmagan. Bu narsaga juda ham etiborli bulishimiz kerak zero Rasululloh SAV aytadilar;
Anas roziyallohu anhudan rivoyat qilinadi: «Mening sizlarga ko‘p hadis aytishimni man qiladigan narsa Payg‘ambar sollallohu alayhi vasallamning: «Kim menga yolg‘onni qasd qilsa, do‘zaxdagi o‘rindig‘ini olaversin», deganlaridir», dedi». To‘rtovlari rivoyat qilishgan.

Muslimning rivoyatida: «Albatta, menga yolg‘on to‘qish boshqa birovga yolg‘on to‘qishdek emas. Kim menga yolg‘onni qasd qilsa, do‘zaxdagi o‘rindig‘ini olaversin», deyilgan.
